import React from 'react';
import Header from '../components/Header/Header';
import Footer from '../components/Footer/Footer';
import DateDisplay from '../components/DateDisplay';

// Assuming the components exist in the correct locations, the import statements should be correct.

const HomePage: React.FC = () => {
    return (
        <div style={{ position: 'relative', width: '100%', display: 'flex', justifyContent: 'center', alignItems: 'center', flexDirection: 'column', backgroundColor: "black" }}>
              
            <Header />
            <h1 style={{ fontSize: '4em', color: "GrayText" }}>Hello world!</h1>  
            <DateDisplay />
            <Footer />
        </div>
    );
};

export default HomePage;
